import { __decorate } from "tslib";
import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { environment } from 'src/environments/environment';
let CreateProfileService = class CreateProfileService {
    constructor(http) {
        this.http = http;
        this.baseUrl = environment.apiUrl;
    }
    uploadResume(candidateId, fileData) {
        return this.http.post(`${this.baseUrl}/candidate/${candidateId}/resume/upload`, fileData, { responseType: 'text' });
    }
    downloadResume(candidateId) {
        return this.http.get(`${this.baseUrl}/candidate/${candidateId}/resume/download`, { responseType: 'blob' });
    }
    updateEmployerProfile(employerId, formData) {
        return this.http.patch(`${this.baseUrl}/employer/${employerId}/profile`, formData);
    }
    updateCandidateProfile(candidateId, formData) {
        return this.http.patch(`${this.baseUrl}/candidate/${candidateId}/profile`, formData);
    }
    generateResume(candidateId) {
        return this.http.get(`${this.baseUrl}/candidate/${candidateId}/resume/generate`, { responseType: 'blob' });
    }
};
CreateProfileService.ctorParameters = () => [
    { type: HttpClient }
];
